package com.shz.workbook.neetcode;

import java.util.HashMap;
import java.util.Map;

/**
 * @author shenazz
 */
public class AnagramChecker1 {

	public static void main(String[] args) {
		String s = "";
		String t = "";

		AnagramChecker1 anagramChecker = new AnagramChecker1();
		boolean anagram = anagramChecker.isAnagram(s, t);
		System.out.println(anagram);

	}

	public boolean isAnagram(String s, String t) {

		if (s == null || t == null || s.length() != t.length()) {
			return false;
		}

		Map<Character, Integer> sCharCounts = getCharCounts(s);
		Map<Character, Integer> tCharCounts = getCharCounts(t);

		for (Character x : sCharCounts.keySet()) {
			Integer sChar = sCharCounts.get(x);
			Integer tChar = tCharCounts.get(x);
			if (tChar == null || !sChar.equals(tChar)) {
				return false;
			}
		}
		return true;
	}

	private Map<Character, Integer> getCharCounts(String value) {
		Map<Character, Integer> tracker = new HashMap<>();
		for (int i = 0; i < value.length(); i++) {
			char currentChar = value.charAt(i);
			Integer count = tracker.get(currentChar);
			if (count == null) {
				count = 0;
			}
			tracker.put(currentChar, ++count);
		}

		return tracker;
	}

}
